Added Fresco Vito prefetcher Summary:
Usage:
```
public void prefetch() {
    FrescoVitoPrefetcher prefetcher = DefaultFrescoContext.get().getPrefetcher();

    DataSource<Void> prefetchSource = prefetcher.prefetchToBitmapCache(
            URI,
            IMAGE_OPTIONS,
            CALLER_CONTEXT);

    // Cancel the prefetch:
    prefetchSource.close();
  }
```

When you fetch the image:
```
 return FrescoVitoImage.create(c)
        .uri(URI)
        .imageOptions(IMAGE_OPTIONS)
        .callerContext(CALLER_CONTEXT)
        .build();
```

