Open source Fresco Vito Litho module Summary:
We're open sourcing our new (and experimental) Fresco Vito Litho module that includes an image spec to display pictures.

Example usage:

```
private static final ImageOptions IMAGE_OPTIONS = ImageOptions.create()
    .placeholderRes(R.drawable.placeholder)
    .round(RoundingOptions.asCircle())
    .build();

public Component createComponent(ComponentContext c) {
  return FrescoVitoImage.create(c)
      .uri(myUrl)
      .imageOptions(IMAGE_OPTIONS)
      .build();
  }
```

